import './Auth.scss';
import { FormLogin, FormRegistration, FormRestore } from './components/Forms';
import { Tab, Row, Col, Nav } from 'react-bootstrap';

function AuthPanel() {


    return (
        <div className="auth col-3 p-0">
            <Tab.Container id="left-tabs-example" defaultActiveKey="login">
                <Row>
                    <Nav variant="pills" className="flex-column">
                        <Nav.Item>
                        <Nav.Link eventKey="login">Login</Nav.Link>
                        </Nav.Item>
                        <Nav.Item>
                        <Nav.Link eventKey="registration">Registration</Nav.Link>
                        </Nav.Item>
                    </Nav>


                    <Tab.Content>
                        <Tab.Pane eventKey="login">
                            1
                        </Tab.Pane>
                        <Tab.Pane eventKey="registration">
                            2
                        </Tab.Pane>
                    </Tab.Content>
                </Row>
            </Tab.Container>
        </div>
    );
}

export default AuthPanel;
